    sched_params_t sched_params = (sched_params_t) {
                            .num_reactions_per_level = &num_reactions_per_level[0],
                            .num_reactions_per_level_size = (size_t) 16};
    lf_sched_init(
        &envs[dualmodelreactor_main],
        envs[dualmodelreactor_main].num_workers,
        &sched_params
    );
